sƒ± Olarak Benimsemekte ve Uygulamaktadƒ±r.</p>\n                        <div class=\"row\">\n                            <p>ƒ∞≈ü g√ºc√º firmasƒ± olarak enerji santrallerinde montaj, i≈ületme ve bakƒ±m faaliyetleri ger√ßekle≈ütiren firmamƒ±zƒ±n √∂nceliƒüinin \"ƒ∞nsan Fakt√∂r√º\" olduƒüunu daima hatƒ±rlamak,</p>\n\n                            <p>En deƒüerli kazancƒ±mƒ±z olan √ßalƒ±≈üanlarƒ±mƒ±zƒ±n saƒülƒ±ƒüƒ±, i≈ü g√ºvenliƒüi ve m√º≈üterilerimizin\n                            memnuniyetini Kalite ve ƒ∞≈ü√ßi Saƒülƒ±ƒüƒ± ve ƒ∞≈ü G√ºvenliƒüi politikamƒ±zƒ±n temeli olarak benimsemek,</p>\n\n                            <p>G√ºven, disiplin, √ßalƒ±≈ükanlƒ±k ve yeterlilik prensiplerinden g√º√ß alan Pro-Per firmasƒ± yaptƒ±ƒüƒ± i≈üi;\n                            ilk seferde, vaad ettiƒüi s√ºrede ve hatasƒ±z olarak tamamlayarak m√º≈üteri beklentilerinin de\n                            √ºzerindeki bir kalite anlayƒ±≈üƒ± ve ciddiyet i√ßinde yapmak,</p>\n\n                            <p>S√ºrekli deƒüi≈üen ve geli≈üen m√º≈üteri beklentilerini tespit etmek ve kar≈üƒ±lamak adƒ±na; projelerin\n                            ve m√º≈üteri talimatlarƒ±nƒ±n dikkatle takip etmek,</p>\n\n                            <p>Davranƒ±≈ü bi√ßimleri, kƒ±yafetleri, i≈ü disiplinleri, teknik donanƒ±mlarƒ± ile aldƒ±klarƒ± eƒüitimi ve\n                            tecr√ºbelerini yansƒ±tan personelini s√ºrekli denetleyerek, personelin teknik yeterliliƒüini kalite\n                            beklentileri √ßer√ßevesinde arttƒ±rmak,\n                            </p>\n                            <p>Yapmƒ±≈ü olduƒüu denetimler sonucunda ortaya √ßƒ±kan ihtiya√ß halinde personelini eƒüiterek\n                            s√ºrekli geli≈üim ve iyile≈ütirme saƒülamak,</p>\n\n                            <p>√áaƒüƒ±n gerekliliƒüi olan teknolojik geli≈ümeleri yakƒ±ndan takip etmek suretiyle; Gerek personel\n                            eƒüitiminde, gerekse kullandƒ±ƒüƒ± ekipmanlarda teknolojik yeniliklerin adaptasyonunu saƒülayarak\n                            m√º≈üteri memnuniyetini, √ßalƒ±≈üan g√ºvenliƒüini ve i≈ü kalitesini arttƒ±rmak.</p>\n\n                        </div>\n                </section>\n            </div>', '1', '0', '1', '0000-00-00 00:00:00', '2014-08-04 19:39:39'), ('34', '38', 'Bireysel Hakkƒ±mƒ±zda Vizyon Misyon', '            <div class=\"container clearfix main-page\">\n\n                <aside class=\"green-bg forced-left\">\n                    <input type=\"submit\" class=\"btn-green\" value=\"HIDE MENU\">\n                    <ul>\n                        <li>\n                            <a href=\"/cms/bireysel-hakkimizda\">HAKKIMIZDA</a>\n                            <ul>\n                                <li><a href=\"/cms/bireysel-yonetim-takimimiz\">Y√∂netim Takƒ±mƒ±mƒ±z</a></li>\n                                <li><a href=\"/cms/bireysel-kalite-politikamiz\">Kalite Politikamƒ±z</a></li>\n                                <li class=\"active\"><a href=\"/cms/bireysel-vizyon-ve-misyonumuz\">Vizyon ve Misyonumuz</a></li>\n                            </ul>\n                        </li>\n                        <li><a href=\"/cms/bireysel-haberler\">HABERLER</a></li>\n                        <li><a href=\"/cms/bireysel-basin-odasi\">BASIN ODASI</a></li>\n                        <li><a href=\"/cms/bireysel-sikca-sorulan-sorular\">SIK√áA SORULAN SORULAR</a></li>\n                        <li><a href=\"/cms/bireysel-iletisim\">ƒ∞LETƒ∞≈ûƒ∞M</a></li>\n                    </ul>\n                </aside>\n\n                <section class=\"content-section\">\n                        <input type=\"submit\" class=\"btn-green show-menu-btn\" value=\"MENU\">\n                        <h2>Vizyon ve <br> Misyonumuz</h2>\n                        <div class=\"bottom-line\"></div>\n                        <p>It has survived not only five centuries, but also the leap into electronic\ntypesetting, remaining essentially unchanged. </p>\n<br clear=\"all\">\n<br clear=\"all\">\n\n                        <div class=\"row\">\n                        <h4><b>Vƒ∞ZYON</b></h4>\n                           <p> Enerji sekt√∂r√ºnde, yurti√ßi ve yurtdƒ±≈üƒ± piyasalarda verilen hizmetin kalitesinden, ƒ∞≈ü√ßi Saƒülƒ±ƒüƒ± ve ƒ∞≈ü G√ºvenliƒüinden √∂d√ºn vermeden, zamanƒ±nda i≈ü bitirmeyi ve m√º≈üteri memnuniyetini kendine ilke edinmi≈ü personeli ile s√ºrekli geli≈ümeye odaklanmƒ±≈ü T√ºrkiye\'nin lider kurulu≈üu olmaktƒ±r.\n                           </p>\n                        </div>\n                        <br clear=\"all\">\n                        <br clear=\"all\">\n\n                        <div class=\"row\">\n                        <h4><b>Mƒ∞SYON</b></h4>\n                           <p> Vizyonumuz doƒürultusunda her t√ºrl√º ticari, ahlaki, hukuki kurallara saygƒ±lƒ± ve bu kurallarƒ± harfiyen yerine getiren; m√º≈üterilerine, √ßalƒ±≈üanlarƒ±na ve ili≈üki i√ßerisinde bulunduƒüu t√ºm kesimlere katkƒ±larƒ±nƒ± s√ºrekli olarak geli≈ütiren dinamik bir organizasyon olmak. Bunun i√ßin Toplam Kalite Y√∂netimi, ƒ∞≈ü√ßi Saƒülƒ±ƒüƒ± ve ƒ∞≈ü G√ºvenliƒüi felsefesini ve s√ºrekli geli≈üim anlayƒ±≈üƒ±nƒ± ilke edinerek m√ºkemmele yolculukta devamlƒ± mesafe kaydetmektir.</p>\n                        </div>\n                </section>\n            </div>\n            <br clear=\"all\">\n            <br clear=\"all\">\n', '1', '0', '1', '0000-00-00 00:00:00', '2014-08-04 20:01:52'), ('35', '41', 'Kurumsal Hakkƒ±mƒ±zda Kalite Politikamƒ±z', '<div class=\"container clearfix main-page\">\n\n                <aside class=\"green-bg forced-left\">\n                    <input type=\"submit\" class=\"btn-green\" value=\"HIDE MENU\">\n                    <ul>\n                        <li>\n                            <a href=\"/cms/kurumsal-hakkimizda\">HAKKIMIZDA</a>\n                            <ul>\n                                <li><a href=\"/cms/kurumsal-yonetim-takimimiz\">Y√∂netim Takƒ±mƒ±mƒ±z</a></li>\n                                <li class=\"active\"><a href=\"/cms/kurumsal-kalite-politikamiz\">Kalite Politikamƒ±z</a></li>\n                                <li><a href=\"/cms/kurumsal-vizyon-ve-misyonumuz\">Vizyon ve Misyonumuz</a></li>\n                            </ul>\n                        </li>\n                        <li><a href=\"/cms/kurumsal-haberler\">HABERLER</a></li>\n                        <li><a href=\"/cms/kurumsal-basin-odasi\">BASIN ODASI</a></li>\n                        <li><a href=\"/cms/kurumsal-sikca-sorulan-sorular\">SIK√áA SORULAN SORULAR</a></li>\n                        <li><a href=\"/cms/kurumsal-iletisim\">ƒ∞LETƒ∞≈ûƒ∞M</a></li>\n                    </ul>\n                </aside>\n\n                <section class=\"content-section\">\n                        <input type=\"submit\" class=\"btn-green show-menu-btn\" value=\"MENU\">\n                        <h2>Kalite<br> Politikamƒ±z</h2>\n                        <div class=\"bottom-line\"></div>\n                        <p>Pro-Per A≈üaƒüƒ±dakƒ± ƒ∞lke ve Prensipleri Kalite ve ƒ∞≈ü√ßi Saƒülƒ±ƒüƒ± ve ƒ∞≈ü G√ºvenliƒüi\nPolitikasƒ± Olarak Benimsemekte ve Uygulamaktadƒ±r.</p>\n                        <div class=\"row\">\n                            <p>ƒ∞≈ü g√ºc√º firmasƒ± olarak enerji santrallerinde montaj, i≈ületme ve bakƒ±m faaliyetleri ger√ßekle≈ütiren firmamƒ±zƒ±n √∂nceliƒüinin \"ƒ∞nsan Fakt√∂r√º\" olduƒüunu daima hatƒ±rlamak,</p>\n\n                            <p>En deƒüerli kazancƒ±mƒ±z olan √ßalƒ±≈üanlarƒ±mƒ±zƒ±n saƒülƒ±ƒüƒ±, i≈ü g√ºvenliƒüi ve m√º≈üterilerimizin\n                            memnuniyetini Kalite ve ƒ∞≈ü√ßi Saƒülƒ±ƒüƒ± ve ƒ∞≈ü G√ºvenliƒüi politikamƒ±zƒ±n temeli olarak benimsemek,</p>\n\n                            <p>G√ºven, disiplin, √ßalƒ±≈ükanlƒ±k ve yeterlilik prensiplerinden g√º√ß alan Pro-Per firmasƒ± yaptƒ±ƒüƒ± i≈üi;\n                            ilk seferde, vaad ettiƒüi s√ºrede ve hatasƒ±z olarak tamamlayarak m√º≈üteri beklentilerinin de\n                            √ºzerindeki bir kalite anlayƒ±≈üƒ± ve ciddiyet i√ßinde yapmak,</p>\n\n                            <p>S√ºrekli deƒüi≈üen ve geli≈üen m√º≈üteri beklentilerini tespit etmek ve kar≈üƒ±lamak adƒ±na; projelerin\n                            ve m√º≈üteri talimatlarƒ±nƒ±n dikkatle takip etmek,</p>\n\n                            <p>Davranƒ±≈ü bi√ßimleri, kƒ±yafetleri, i≈ü disiplinleri, teknik donanƒ±mlarƒ± ile aldƒ±klarƒ± eƒüitimi ve\n                            tecr√ºbelerini yansƒ±tan personelini s√ºrekli denetleyerek, personelin teknik yeterliliƒüini kalite\n                            beklentileri √ßer√ßevesinde arttƒ±rmak,\n                            </p>\n                            <p>Yapmƒ±≈ü olduƒüu denetimler sonucunda ortaya √ßƒ±kan ihtiya√ß halinde personelini eƒüiterek\n                            s√ºrekli geli≈üim ve iyile≈ütirme saƒülamak,</p>\n\n                            <p>√áaƒüƒ±n gerekliliƒüi olan teknolojik geli≈ümeleri yakƒ±ndan takip etmek suretiyle; Gerek personel\n                            eƒüitiminde, gerekse kullandƒ±ƒüƒ± ekipmanlarda teknolojik yeniliklerin adaptasyonunu saƒülayarak\n                            m√º≈üteri memnuniyetini, √ßalƒ±≈üan g√ºvenliƒüini ve i≈ü kalitesini arttƒ±rmak.</p>\n\n                        </div>\n                </section>\n            </div>', '1', '0', '1', '0000-00-00 00:00:00', '2014-08-04 20:08:20'), ('36', '40', 'Kurumsal Hakkƒ±mƒ±zda Y√∂netim Takƒ±mƒ±mƒ±z', '            <div class=\"container clearfix main-page\">\n\n                <aside class=\"green-bg forced-left\">\n                    <input type=\"submit\" class=\"btn-green\" value=\"HIDE MENU\">\n                    <ul>\n                        <li>\n                            <a href=\"/cms/kurumsal-hakkimizda\">HAKKIMIZDA</a>\n                            <ul>\n                                <li class=\"active\"><a href=\"/cms/kurumsal-yonetim-takimimiz\">Y√∂netim Takƒ±mƒ±mƒ±z</a></li>\n                                <li><a href=\"/cms/kurumsal-kalite-politikamiz\">Kalite Politikamƒ±z</a></li>\n 